with open('sir.in', 'r') as f:
    n = int(f.readline())

def look_and_say(n):
    if n == 1:
        return '1'
    else:
        prev = look_and_say(n - 1)
        result = []
        count = 1
        for i in range(1, len(prev) + 1):
            if i < len(prev) and prev[i] == prev[i - 1]:
                count += 1
            else:
                result.extend([str(count), prev[i - 1]])
                count = 1
        return ''.join(result)

with open('sir.out', 'w') as f:
    f.write(look_and_say(n))
